import React, { Component } from 'react';
import './style/App.css';
import TelaInicial from "./components/TelaInicial";
class App extends Component{
    constructor(props) {
        super(props);
        this.state = {
            rota: 'Login'
        }
    }
    render() {
        return (
            <TelaInicial rota={this.state.rota} onCadastrar={(event) => { this.setState({value:'Cadastro'}) }}/>
        );
    }
}

export default App;
